import React from "react";
import { Link, Outlet } from "react-router-dom";

const App = () => {
  return (
    <>
      <div className="logo">
        <img src="clear2.png" />
      </div>
      <div className="app">
        <nav className="navigator">
          <Link to="/" className="home-nav">
            Home
          </Link>
          <Link to="Login" className="login-nav">
            Login
          </Link>
          <Link to="Register" className="register-nav">
            Register
          </Link>
        </nav>
      </div>

      <div></div>
      <Outlet />
    </>
  );
};

export default App;
